import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { MatDialog } from '@angular/material/dialog';
import { ModalComplaintComponent } from '../modal-complaint/modal-complaint.component';

@Component({
  selector: 'app-complaints',
  templateUrl: './complaints.component.html',
  styleUrls: ['./complaints.component.scss']
})
export class ComplaintsComponent implements OnInit {

  complaints = [
    {
      id: 1,
      // tslint:disable-next-line:max-line-length
      image: 'data:image/jpeg;base64,',
      complaint: 'The potholes near Bhavan\'s Main Gate',
      lat: 19.1231776,
      lng: 72.8339267,
      timeStamp: '1573034952',
    }
  ];

  constructor(protected router: Router, public dialog: MatDialog) { }

  open(id) {
    const comp = this.complaints.find(c => {
      return id === c.id;
    });
    const dialogRef = this.dialog.open(ModalComplaintComponent, {
      width: '800px',
      height: '500px',
      data: {cmp: comp}
    });

    dialogRef.afterClosed().subscribe(result => {
      console.log('The dialog was closed');
      console.log(result);
      const id = result;
    });
  }

  ngOnInit() {
  }

}
